<p>The keys red and blue come from the key color.</p>
<p>@turivishal requested more info:</p>
<p>I want to use $bucket.</p>
<pre><code>{ '$bucket': {
     groupBy: '$value.*red*.level1.level2',
     boundaries: [1,2,3,4,5,6,7,8,9],
     output: { 
       count: { '$sum': 1 }}}}
</code></pre>
<p>The expected result would be</p>
<pre><code>[{ id: 5, count: 1}, { id: 8, count: 1 }]
</code></pre>

