How to serialize GUID properties as string in MongoDb?<p>I want to serialize a <code>Dictionary&lt;string, object&gt;</code> object in such a way that whenever the value is a <code>Guid</code> (or within the object graph of the value there is a <code>Guid</code>), the <code>Guid</code> is serialized as a string.</p>
<p>I tried running the following test:</p>
<pre><code>Guid id = new (&quot;11536e02-fcf3-4a8f-8b1d-ddfa6b4cee8a&quot;);
BsonSerializer.RegisterSerializer(new GuidSerializer(BsonType.String));
string json1 = BsonExtensionMethods.ToJson(id); // &quot;11536e02-fcf3-4a8f-8b1d-ddfa6b4cee8a&quot;
string json2 = BsonExtensionMethods.ToJson(new[] {id}); // [&quot;11536e02-fcf3-4a8f-8b1d-ddfa6b4cee8a&quot;]
string json3 = BsonExtensionMethods.ToJson(new {Id = id}); // { &quot;Id&quot;: &quot;11536e02-fcf3-4a8f-8b1d-ddfa6b4cee8a&quot; }
string json4 = BsonExtensionMethods.ToJson(new Dictionary&lt;string, object&gt; {[&quot;Id&quot;] = id}); // { &quot;Id&quot; : CSUUID(&quot;11536e02-fcf3-4a8f-8b1d-ddfa6b4cee8a&quot;) }
</code></pre>
<p>Everything works fine up to <code>json4</code> which I expected to be identical to <code>json3</code>, but for some reason nested GUID values in dictionaries are still serialized in binary. How do I tell MongoDB to globally serialize <em>all</em> GUIDs as strings?</p>

