Handlebars returns empty string<p>Searched the internet for what could be wrong with my code, but couldn't find anything. What exactly am I doing wrong? Could it be that I'm not passing the data to the <code>.hbs</code> file correctly?</p>
<p>The page is a simple blog website. You post the title and the text - so it appears on the main page. This is what the model looks like:</p>
<pre><code>const { Schema, model } = require('mongoose')

const schema = new Schema({
    title: { // A TITLE
        type: String,
        required: true
    },
    content: { // A TEXT OF THE ARTICLE
        type: String,
        require: true
    }
})

module.exports = model('Article', schema)
</code></pre>
<p>Next, I want to use this data on my pages and I write the following in the routes:</p>
<pre><code>const { Router } = require('express')
const articles = require('../models/articles')
const router = Router()

router.get('/', (req, res) =&gt; {
    res.render('index', {data: articles}) // HERE I USE THE COLLECTION
})

router.get('/post', (req, res) =&gt; {
    res.render('post', {isPost: true})
})

router.post('/post', async (req, res) =&gt; {
    const article = new articles({
        title: req.body.title,
        content: req.body.content
    })

    await article.save()
    res.redirect('/')
})

module.exports = router
</code></pre>
<p>As you can see above, there are only three routes. The first is the main page, where I use data from the database. The second is just a form where I go to write an article. Don't take attention to the <code>IsPost</code> variable, it is needed for the button in the header, and everything works there. The third route comes after we confirm the data and they are thrown into the database. I look into MongoDB and see that everything is fine. The data is really saved, the form works, I'm happy.</p>
<p><a href="https://i.stack.imgur.com/HWUxW.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/HWUxW.png" alt="Collection in MongoDB" /></a></p>
<p>Now it remains to display the data. This is where the problem begins. This is how I display data on the page (it's Bootstrap):</p>
<pre><code>// HERE IMPORTANT PART OF CODE BEGINS
{{#if data.length}}
    &lt;div style=&quot;max-width: 1240px&quot; class=&quot;d-flex justify-content-center mx-auto&quot;&gt;
        &lt;div class=&quot;d-flex mt-5&quot;&gt;
                &lt;div class=&quot;d-flex row flex-wrap justify-content-center&quot;&gt;
                    {{#each data}}
                        &lt;div class=&quot;rounded border bg-light custom-item p-3 m-1&quot;&gt;
                            &lt;h4&gt;{{this.title}}&lt;/h4&gt;
                            &lt;p class=&quot;text&quot;&gt;{{this.content}}&lt;/p&gt;
                        &lt;/div&gt;
                    {{/each}}
                &lt;/div&gt;
        &lt;/div&gt;
    &lt;/div&gt;
    // HERE ENDS IMPORTANT PART OF THE CODE

    &lt;style&gt;
        .custom-item{
            width: 240px;
            height: 240px;
        }

        .text{
            overflow: hidden;
            text-overflow: ellipsis;
            display: -webkit-box;
            -webkit-line-clamp: 7;
                    line-clamp: 7; 
            -webkit-box-orient: vertical;
        }
    &lt;/style&gt;

{{else}}
</code></pre>
<p>Instead of outputting blocks with titles and their full text, it outputs this:</p>
<p><a href="https://i.stack.imgur.com/LxtMp.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/LxtMp.png" alt="Result" /></a></p>
<p>Note. Only two blocks with <code>h4</code> and <code>p</code> tags are displayed, but they are empty. Exactly two blocks are displayed, although there are only three records in the database. When I change their number, there will always be two blocks on the page.</p>
<p>And here is the final question. How does my code work and why does it output exactly two blocks? How can I fix the code so that every record is retrieved from the database? Write if I forgot to add something else.</p>

