MongoDB writing conflict for simple session-based parallel request<p>I have an Express based CRUD application which uses MongoDB as its DB. I have noticed that some concurrent writes fail if they use <code>bulkWrite</code> and <code>session</code>.</p>
<p>A simplified example looks like this:</p>
<pre><code>import express from 'express';
import { v4 } from 'uuid';
import mongoose from 'mongoose';

const router = express.Router();

const mongoString = 'mongodb://127.0.0.1:27017/testMongo?directConnection=true';
const port = 3288;
const testId = mongoose.Types.ObjectId();

const Model = mongoose.model('Data', new mongoose.Schema({
  whateverString: {
    required: true,
    type: String,
  },
}));

mongoose.connect(mongoString);
const database = mongoose.connection;

database.on('error', (error) =&gt; {
  console.log(error);
});

database.once('connected', async () =&gt; {
  console.log('Database connected');

  // Add test data if not exists
  if (!await Model.exists({ _id: testId })) {
    const data = new Model({
      _id: testId,
      whateverString: v4(),
    });
    await data.save();
  }
});

const app = express();
app.use(express.json());

router.post('/', async (req, res) =&gt; {
  const session = await mongoose.startSession();
  session.startTransaction();
  try {
    await Model.bulkWrite([
      {
        updateOne: {
          filter: {
            _id: testId,
          },
          update: {
            whateverString: v4(),
          },
        },
      },
    ], { session });
    await session.commitTransaction();
    res.status(200).json({ allRight: true });
  } catch (error) {
    await session.abortTransaction();
    console.log(error.message);
    res.status(400).json({ message: error.message });
  } finally {
    session.endSession();
  }
});

app.use('/', router);

app.listen(port, async () =&gt; {
  console.log(`Server started at ${port}`);
});

</code></pre>
<p>What this does is:</p>
<ul>
<li>connecting to Mongo</li>
<li>creating a test document</li>
<li>creating a web server and one post route</li>
<li>if the post route is called, the test document is updated with a random string in a <code>bulkWrite</code> and a <code>session</code></li>
</ul>
<p>Now take a simple client script which does three requests in parallel:</p>
<pre><code>import fetch from 'node-fetch';

function doFetch() {
  return fetch('http://localhost:3288', { method: 'post' });
}

async function myMain() {
  try {
    const promises = [doFetch(), doFetch(), doFetch()];
    const response = await Promise.all(promises);
    console.log('response', response.map(resp =&gt; ({ status: resp.status, text: resp.statusText })));
  } catch (error) {
    console.log(error);
  }
}

myMain();

</code></pre>
<p>The result is: Only one DB query works, whereas the others fail with the error <code>WriteConflict error: this operation conflicted with another operation. Please retry your operation or multi-document transaction.</code></p>
<p>I am rather new to MongoDB and Mongoose but in my understanding of databases, such a use-case should be fine. (In this example, the requests would overwrite each other and create chaos, but in the real-life use case that should not be a problem at all.)</p>
<p>Some observations I've made:</p>
<ul>
<li>Without passing <code>session</code> to <code>bulkWrite</code>, everything works fine.</li>
<li>It is obviously some kind of race condition: sometimes two queries go through, sometimes only one.</li>
<li>Setting <code>maxTransactionLockRequestTimeoutMillis</code> to 20000 did not help.</li>
<li>If I include the fetching in the server process itself (after <code>console.log('Server started ...</code>), then everything works fine. I cannot explain that to be honest.</li>
</ul>
<p>What am I doing wrong? How can I solve that problem?</p>
<p>Appendix: The <code>package.json</code> file of that example looks like this:</p>
<pre><code>{
  &quot;name&quot;: &quot;rest-api-express-mongo&quot;,
  &quot;dependencies&quot;: {
    &quot;express&quot;: &quot;^4.17.3&quot;,
    &quot;mongoose&quot;: &quot;^6.2.2&quot;,
    &quot;node-fetch&quot;: &quot;^3.2.10&quot;,
    &quot;uuid&quot;: &quot;^9.0.0&quot;
  },
  &quot;type&quot;: &quot;module&quot;
}
``
</code></pre>

