NestJS Mocking Injected Connection Imported from Different Module<p>I've been getting this error all day long:</p>
<pre><code>Nest can't resolve dependencies of the ClubsService (ClubsApiService, AuthApiService, ClubFollowersRepo, ClubsRepo, ClubPrivacyRepo, ?). Please make sure that the argument DatabaseConnection at index [5] is available in the ClubsModule context.

Potential solutions:
- If DatabaseConnection is a provider, is it part of the current ClubsModule?
- If DatabaseConnection is exported from a separate @Module, is that module imported within ClubsModule?
  @Module({
    imports: [ /* the Module containing DatabaseConnection */ ]
  })
</code></pre>
<p>I figured that the problem is, that I have not mocked the Mongo DB connection. The error is quite clear, the <code>@InjectConnection</code> in <code>ClubsService</code> should be mocked (see below).</p>
<p>ClubsService:</p>
<pre><code>@Injectable()
export class ClubsService {
  constructor(
    private readonly clubsApiService: ClubsApiService,
    private readonly authApiService: AuthApiService,
    private readonly clubFollowersRepo: ClubFollowersRepo,
    private readonly clubsRepo: ClubsRepo,
    private readonly clubPrivacyRepo: ClubPrivacyRepo,
    @InjectConnection() private readonly connection: Connection,   // &lt;--- THIS GUY
  ) {}
// ...
}
</code></pre>
<p>The problem is that the test file I am executing is in a different module than where <code>ClubsService</code> is. And so in the different module (let's call it <code>YModule</code>), I have this piece of code:</p>
<p>YModule:</p>
<pre><code>import { getConnectionToken } from '@nestjs/mongoose';
import { MongoMemoryServer } from 'mongodb-memory-server';
import { Connection, connect } from 'mongoose';

describe('YService.spec.ts in YModule', () =&gt; {

  beforeAll(async () =&gt; {
    mongod = await MongoMemoryServer.create();
    const uri = mongod.getUri();
    mongoConnection = (await connect(uri)).connection;
  });

  beforeEach(async () =&gt; {
    const module: TestingModule = await Test.createTestingModule({
      providers: [
         // ...
      ],
      imports: [ClubsModule],  // &lt;--- ClubsModule is not provider, but imported module
    })
      .overrideProvider(getConnectionToken())
      .useValue(mongoConnection)
      .compile();
  });
});
</code></pre>
<p>This approach with <code>getConnectionToken()</code> won't work as I have to mock a connection coming from the imported <code>ClubsModule</code>, not a provider.</p>
<p>How would you mock a connection injected in a different module that you imported?</p>
<p>Thanks a lot! :)</p>

